import React from "react";
import cuate from "./Used Images/cuate.png";

function Info() {
    return (<>
    <div className="container text-center mt-5">
        <h1>Real Estate-Focused Digital Mastery</h1>
        <div className="row">
            <div className="col-md-6 mt-3"><img src={cuate}/></div>
            <div className="col-md-6 mt-3 img-info">
                <h3>Unlock the Potential of Digital Real Estate Excellencex</h3>
                <p>At Osumare, we understand that the real estate landscape demands a digital presence that aligns with the intricacies of property marketing. Our range of specialized services is meticulously designed to catapult your brand's success in the ever-evolving digital property market.</p></div>
        </div>
    </div>
    </>);
}
export default Info;
